import React from "react";
import ReactDOM from "react-dom";
import "bootstrap/dist/css/bootstrap.css";

class NavBar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <nav>
          <a> Rapid </a>
          <button>
            <span className="navbar-toggle-icon"> </span>
          </button>
        </nav>
      </div>
    );
  }
}

export default NavBar;
